import React from 'react'
import './Intro.css'

const Intro = () => {
    return (
        <div className="intro">
            <div className="i-left">
                <div className="i-name">
                    <span> Hello there!</span>
                    <span> I Am Manny Cestoni</span>
                    <span> A Full Stack Software Engineer with enterprise level experience
                     in software development and wed design. My goal is to ensure I provide you with
                    the best quality service at industry standards.</span>
                </div>
                <button className="button i-button"> Hire Me</button>
            </div>


            <div className="i-right">
                The Right Side
            </div>
        </div>
    )
}

export default Intro

